import React,{useState,useEffect} from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Card from "../components/Cards/Card";
import MisalPav from "../components/Cards/Misalpav";
import VegSand from "../components/Cards/Veg-Sandwhich";
import PaneerSand from "../components/Cards/Panner-Sandwhich";
import Carousal from "../components/Carousal";

function Home() {

  const [search,setSearch]=useState('');
  const {fooditems,error}=useFoodItems();

  const filteredItems=foodItems.filter(item=>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  if(error){
    return <div>Error loading items: {error.message}</div>;
  }

  return (
    <div>
      {/* <div><Navbar /></div> */}
      
      <div className="container m-3 d-flex">
        <div className="flex-fill me-3">
          <Card />
          <MisalPav />
        </div>
        <div className="flex-fill ms-3">
          <PaneerSand />
          <VegSand />
        </div>
      </div>
      <div><Footer /></div>
    </div>
  );
}

export default Home;
